import React from 'react'

const useCustomRoute = () => {

    const pushQuery = (query) => {
        console.log(query)
        const newQuery = new URLSearchParams(query).toString()
        console.log(newQuery)
    }
    return {pushQuery}
}

export default useCustomRoute
